import {createContext} from 'react';

import MenuAppBar from './Homepage/MenuAppBar';
import NestedList from './Homepage/NestedList';
import LabelBottomNavigation from './Homepage/LabelBottomNavigation';

export const WorkspaceContext = createContext();

/**
 * @return {object} JSX
 */
function Homepage() {
  const [workspaceList, setWorkspaceList] = React.useState([]);
  const [workspace, setWorkspace] = React.useState('');

  return (
    <div>
      <WorkspaceContext.Provider
        value={{value: [workspaceList, setWorkspaceList],
          value2: [workspace, setWorkspace]}}>
        <MenuAppBar/>
        <NestedList/>
      </WorkspaceContext.Provider>
      <LabelBottomNavigation/>
    </div>
  );
}

export default Homepage;
